CREATE TABLE Obesity(
   State                               VARCHAR(20) NOT NULL PRIMARY KEY
  ,County                              VARCHAR(43)
  ,Year                                INTEGER 
  ,number                              INTEGER 
  ,percent                             NUMERIC(7,1)
  ,lower_confidence_limit              NUMERIC(7,1)
  ,upper_confidence_limit              NUMERIC(7,1)
  ,ageadjusted_percent                 NUMERIC(7,1)
  ,ageadjusted_lower_confidence_limit  NUMERIC(7,1)
  ,ageadjusted_upper_confidence_limit  NUMERIC(7,1)
);
